// src/components/GameRow.jsx
import React from 'react';
import styles from './GameRow.module.css'; // Using CSS modules for styling

function GameRow({ game }) {
  return (
    <div className={styles.row}>
      <div className={styles.cell}>{game.title}</div>
      <div className={styles.cell}>{game.genre}</div>
      <div className={styles.cell}>{game.releaseDate}</div>
      <div className={styles.cell}>{game.hltb}</div>
      <div className={styles.cell}>{game.timePlayed}</div>
      <div className={styles.cell}>{game.gameStatus}</div>
      <div className={styles.cell}>{game.score}</div>
    </div>
  );
}

export default GameRow;
